import React, { useState, useEffect, useContext } from 'react';
import { NavLink } from 'react-router-dom';
import { AdminContext } from '../../App';

const Availableusers = () => {
    const { adminState, dispatchadmin } = useContext(AdminContext);
    const [getUsers, setGetUsers] = useState([]);

    const getallusers = async () => {
        try {
            const res = await fetch('/getavailableusers', {
                method: 'GET',
            });

            const data = await res.json();
            setGetUsers(data);
        } catch (error) {
            console.log(error);
        }
    };

    useEffect(() => {
        getallusers();
    }, []);

    const deleteUser = async (e) => {
        const userIdFromDashBoard = e.target.id;

        try {
            await fetch('/deleteUserfromdashboard', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({
                    userIdFromDashBoard,
                }),
            });

            // Refresh the user list after deleting
            getallusers();
        } catch (error) {
            console.log(error);
        }
    };

    const Loginbutton = () => {
        if (adminState) {
            return (
                <div>
                    <button className="logoutbtnDash">
                        <NavLink className="nav-link" to="/adminsignout">
                            logout
                        </NavLink>
                    </button>
                </div>
            );
        } else {
            return (
                <div>
                    <button className="logoutbtnDash">
                        <NavLink className="nav-link" to="/signin">
                            login
                        </NavLink>
                    </button>
                </div>
            );
        }
    };

    return (
        <>
            <div className="sidebar">
                {/* Sidebar content */}
            </div>

            <section className="home-section">
                {/* Header content */}
                <div className="salecartableDiv">
                    <h1 className="heading">
                        <span>Available Users</span>
                    </h1>
                    <p>Number of users: {getUsers.length}</p>


                </div>
            </section>
        </>
    );
};

export default Availableusers;
